function zip(options) {
    return new Promise((resolve) => {
        M.zip.zip({
            ...options,
            callback: (_, result) => {
                resolve(result);
            },
        });
    });
}
function unzip(options) {
    return new Promise((resolve) => {
        M.zip.unzip({
            ...options,
            callback: (_, result) => {
                resolve(result);
            },
        });
    });
}

export { unzip, zip };
